import React, { Fragment } from "react";
import { Button } from "@material-ui/core";

import Parallax from "../../components/parallax/parallax.component";

import Directory from "../../components/directory/directory.component";

const HomePage = () => {
  const image =
    "https://thumbor.thedailymeal.com/l89JXqysFyBCS2k0KPcrqH52OP8=/870x565/https://www.theactivetimes.com/sites/default/files/uploads/r/rsz_front_shutterstock_364445939.jpg";
  return (
    <Fragment>
      <Parallax filter image={image}>
        <a href="#directory" style={{ zIndex: 99 }}>
          <Button variant="contained" color="Secondary">
            Visit Our Store Now
          </Button>
        </a>
      </Parallax>

      <Directory />
    </Fragment>
  );
};

export default HomePage;
